static symbol__* prod(void)
{
  rdp__list* body;
  char* type;
  char* name;
  symbol__* result;
  if (scan__test_set(prod_first, prod_stop, "Expecting one of ALT_ID, NEW_ID, ID"))
  {
     unsigned stars = 0; type = "void"; 
    {
      if (set__inc_element(prod__0_first, scan__sym->token))
      {
        scan__test((name = scan__sym->id,P_NEW_ID), prod_stop, "Expecting 'NEW_ID'");
        scan__();
      }
      else
      if (set__inc_element(prod__1_first, scan__sym->token))
      {
        scan__test((name = scan__sym->id,P_ID), prod_stop, "Expecting 'ID'");
        scan__();
        if (rdp__pass == 1) { \
 scan__error_echo("Doubly defined production '%s'", name);  \
}
      }
      else
      if (set__inc_element(prod__2_first, scan__sym->token))
      {
        scan__test((name = scan__sym->id,P_ALT_ID), prod_stop, "Expecting 'ALT_ID'");
        scan__();
        if (rdp__pass == 1) { \
 scan__error_echo("Doubly defined production '%s'", name);  \
}
      }
    }
     rdp__primary_id = name; rdp__component = 0; \
                      result = rdp__find(rdp__primary_id, K_PRIMARY); \
                      if (rdp__start_prod == NULL) \
                      { \
                        rdp__start_prod = result; \
                        DATA(result, call_count)++; \
                      } \
                   
    if (set__inc_element(prod__15_first, scan__sym->token))
    {
      scan__test(T_13 /* ( */, prod_stop, "Expecting '('");
      scan__();
       result->token = P_ALT_ID; 
      while (set__inc_element(prod__13_first, scan__sym->token))
      {
         rdp__param_list *param = NULL; type = "void"; 
        {
          if (set__inc_element(prod__4_first, scan__sym->token))
          {
            scan__test((name = scan__sym->id,P_NEW_ID), prod_stop, "Expecting 'NEW_ID'");
            scan__();
          }
          else
          if (set__inc_element(prod__5_first, scan__sym->token))
          {
            scan__test((name = scan__sym->id,P_ID), prod_stop, "Expecting 'ID'");
            scan__();
          }
        }
        if (set__inc_element(prod__11_first, scan__sym->token))
        {
          scan__test(T_18 /* : */, prod_stop, "Expecting ':'");
          scan__();
          {
            if (set__inc_element(prod__7_first, scan__sym->token))
            {
              scan__test((type = scan__sym->id,P_NEW_ID), prod_stop, "Expecting 'NEW_ID'");
              scan__();
            }
            else
            if (set__inc_element(prod__8_first, scan__sym->token))
            {
              scan__test((type = scan__sym->id,P_ID), prod_stop, "Expecting 'ID'");
              scan__();
            }
          }
        }
        if (rdp__pass == 1) { \
 param = (rdp__param_list* ) crash__calloc(sizeof(rdp__param_list), "parameter list node"); \
                             param->id = name; \
                             param->type = type; \
                             param->next = DATA(result,params); \
                             DATA(result,params) = param; \
                           \
}
      }
      scan__test(T_15 /* ) */, prod_stop, "Expecting ')'");
      scan__();
    }
    if (set__inc_element(prod__22_first, scan__sym->token))
    {
      scan__test(T_18 /* : */, prod_stop, "Expecting ':'");
      scan__();
      {
        if (set__inc_element(prod__16_first, scan__sym->token))
        {
          scan__test((type = scan__sym->id,P_ID), prod_stop, "Expecting 'ID'");
          scan__();
        }
        else
        if (set__inc_element(prod__17_first, scan__sym->token))
        {
          scan__test((type = scan__sym->id,P_NEW_ID), prod_stop, "Expecting 'NEW_ID'");
          scan__();
        }
      }
      while (set__inc_element(prod__20_first, scan__sym->token))
      {
        scan__test(T_16 /* * */, prod_stop, "Expecting '*'");
        scan__();
         stars++; 
      }
    }
    scan__test(T_20 /* ::= */, prod_stop, "Expecting '::='");
    scan__();
    body = alt();
    if (rdp__pass == 2) { \
 DATA(result, list) = body; \
                                     DATA(result, been_defined) = 1; \
                                     DATA(result, return_type) = type; \
                                     DATA(result, return_type_stars) = stars; \
                                   \
}
    scan__test(T_17 /* . */, prod_stop, "Expecting '.'");
    scan__();
    scan__test_set(prod_stop, prod_stop, "Expecting one of 'USES', 'TITLE', 'TEXT_SIZE', 'TAB_WIDTH', 'SUFFIX', 'SHOW_SKIPS', 'SET_SIZE', 'PRE_PARSE', 'POST_PARSE', 'PASSES', 'OUTPUT_FILE', 'OPTION', 'MAX_WARNINGS', 'MAX_ERRORS', 'INTERPRETER', 'INCLUDE', 'HASH_SIZE', 'HASH_PRIME', 'CASE_INSENSITIVE', ALT_ID, EOF, NEW_ID, ID");
  }
  return result;
}

