void unit(void)
{
  if (scan__test_set(unit_first, unit_stop, NULL))  /* contains null, so no error */
  {
    while (set__inc_element(unit__2_first, scan__sym->token))
    {
      if (set__inc_element(unit__0_first, scan__sym->token))
      {
        prod();
      }
      else
      if (set__inc_element(unit__1_first, scan__sym->token))
      {
        dir();
      }
    }
    scan__test_set(unit_stop, unit_stop, "Expecting EOF");
  }
}

int main(int argc, char *argv[])
{
  clock_t rdp__finish_time, rdp__start_time = clock();
  unsigned
    rdp__tabwidth = 8,            /* tab expansion width */
    rdp__textsize = 23000,          /* size of scanner text array */
    rdp__symbol_statistics = 0,  /* show symbol__ table statistics flag */

    rdp__line_echo = 0;  /* make listing flag */

  while (--argc > 0)
  {
     if ((*++argv)[0] == '-') /* switch */
     {
       switch ((*argv)[1])
       {
         case 'f': /* filter mode */
           rdp__sourcefilename = "-";
           rdp__outputfilename = "-";
           break;
         case 'o':
           if (*(*argv + 2) != 0)
           rdp__outputfilename = *argv + 2;
           break;
         case 'S':
           rdp__symbol_statistics = 1;
           break;
         case 's':
           scan__symbol_echo(1);
           break;
         case 'l':
           rdp__line_echo = 1;
           break;
         case 't':
           sscanf(*argv + 2, "%u", &rdp__tabwidth);
           scan__tab_width(rdp__tabwidth);
           break;
         case 'T':
           sscanf(*argv + 2, "%u", &rdp__textsize);
           break;
         case 'v':
           rdp__verbose = 1;
           break;
         case 'e':
            rdp__expanded = 1; 
           break;
         case 'E':
            rdp__error_production_name = 1; 
           break;
         case 'F':
            rdp__force = 1; 
           break;
         case 'p':
            rdp__parser_only = 1; 
           break;
         default:
           fprintf(MESSAGES, "\nUnrecognised option -%c", (*argv)[1]);
           rdp__help("");
       }
     }
   else
     rdp__sourcefilename = *argv;
  }
  if (rdp__sourcefilename == NULL)
     rdp__help("No source file specified");
  set__init(300);
  symbol__init(101, 31);
  rdp__set_initialise();
  rdp__load_keywords();
  rdp__base = symbol__new_scope("parser");  /* create application scope */
  scan__tab_width(rdp__tabwidth);
  scan__newline_visible(0);
  scan__case_insensitive(0);
  scan__show_skips(1);
  scan__summarise_errors(rdp__verbose);
  scan__init(rdp__textsize,30,120);
  if (rdp__verbose)
     fprintf(MESSAGES, "\nRecursive descent parser generator V1.30 (c) Adrian Johnstone 1994\nGenerated on Dec 29 1994 at 17:39:44 and compiled on " __DATE__ " at " __TIME__ "\n\n");
   rdp__pre_parse(); 
  for (rdp__pass = 1; rdp__pass <= 2; rdp__pass++)
  {
    if (scan__total_errors() != 0)
      crash__("errors detected in source file");   /* crash quietly */ 
    if (rdp__pass == 2)
      scan__line_echo(rdp__line_echo);
    if (scan__open_file(scan__default_filetype(rdp__sourcefilename, "bnf")) == NULL)
      rdp__help("Can't open source file");

    unit();            /* call parser at top level */
  }
  if (rdp__symbol_statistics)
    symbol__print_statistics();
   rdp__post_parse(rdp__outputfilename, rdp__force, rdp__base); 
  if (rdp__verbose)
  {
    rdp__finish_time = clock();
    printf("\n rdp used %f CPU seconds\n", ((double) (rdp__finish_time-rdp__start_time)) / CLOCKS_PER_SEC);
  }
  return rdp__error_return;
}

